import React, { Component } from 'react';

import Tables from '../components/Tables';

var $  = require( 'jquery' );

class HomeOne extends Component {

  componentDidMount(){
    $(function(){
      $('.tableToggle').click(function(){
        $('.table .Header').toggleClass('hide');
        $('.rowData').toggleClass('rowDataCard').toggleClass('col-lg-3');
        $('.table').toggleClass('rowDataCardTable');
      });
    });
}
render() {
    return (
        <div className="wrapper">
            <div className="table-responsive"> 
                <button className="tableToggle">Toggle</button>
              <Tables/>
            </div>
        </div>);
}
}

export default HomeOne;
